column3:
&quot;As an artist, social media is the main and most popular outlet for promotional purposes as well as discovery of new and exciting opportunities. This creates a strange dependence on different platforms that potentially benefit both art consumers and creators. I've had a really hard time finding the balance in how much social media use is really necessary. It gets really easy for artists feel overstimulated with different forms of content, and at its worst it can make the artist feel insecure or discouraged about what they create.&quot;  

- Daniel Lerner, Guitarist &amp; Songwriter

#Ruthere #FeatureFridays #socialmedia #socialworld #mentalhealth
